	assert.NotNil(config)

	collector := mockPrepareCollector{}
	signer := mock.InitSimpleSigner()
	reporter := &mockPrepareReporter{}
	engineContext := common.NewPreparePayoutsEngineContext(&collector, signer, reporter, func(msg string) {})

	result, err := PreparePayouts([]*common.CyclePayoutBlueprint{&blueprint1, &blueprint2}, config, engineContext, &common.PreparePayoutsOptions{
		WaitForSufficientBalance: true,
		Accumulate:               true,
	})
	assert.NoError(err)
	assert.Len(result.Blueprints, 2)
	assertBlueprintsEqual(assert, result.Blueprints[0], &blueprint1)
	assertBlueprintsEqual(assert, result.Blueprints[1], &blueprint2)

	blueprint1InvalidCount := lo.Reduce(blueprint1.Payouts, func(acc int, recipe common.PayoutRecipe, _ int) int {
		if !recipe.IsValid {
			return acc + 1
		}
		return acc
	}, 0)
	blueprint2InvalidCount := lo.Reduce(blueprint2.Payouts, func(acc int, recipe common.PayoutRecipe, _ int) int {
		if !recipe.IsValid {
			return acc + 1
		}
		return acc
	}, 0)
	blueprint1ValidCount := len(blueprint1.Payouts) - blueprint1InvalidCount
	blueprint2ValidCount := len(blueprint2.Payouts) - blueprint2InvalidCount

	assert.Len(result.InvalidPayouts, blueprint1InvalidCount+blueprint2InvalidCount)
	assert.NotEqual(len(result.ValidPayouts), blueprint1ValidCount+blueprint2ValidCount) // because of accumulation
	assert.Len(result.ValidPayouts, 28)

